def item_id_to_name(item_id: int) -> str:
	if not isinstance(item_id, int):
		raise TypeError("item_id must be an int")
	if not (0 <= item_id < len(_item_id_to_name_tuple)):
		return "None"
	return _item_id_to_name_tuple[item_id]


def item_name_to_id(item_name: str) -> tuple[int]:
	if not isinstance(item_name, str):
		raise TypeError("item_name must be an str")
	item_name = ''.join(filter(str.isalnum, item_name)).lower()
	return _item_name_to_id_dict.get(item_name, (0,))


def item_id_to_game_name(item_id: int) -> str:
	if not isinstance(item_id, int):
		raise TypeError("item_id must be an int")
	if not (0 <= item_id < len(_item_id_to_name_tuple)):
		return "None"
	try:
		name = _item_id_to_game_name_dict[item_id]
	except KeyError:
		name = ''.join(filter(str.isalnum, item_id_to_name(item_id)))
	return name


def item_game_name_to_id(item_name: str) -> tuple[int]:
	if not isinstance(item_name, str):
		raise TypeError("item_name must be an str")
	item_name = ''.join(filter(str.isalnum, item_name)).lower()
	try:
		name = _item_game_name_to_id_dict[item_name]
	except KeyError:
		name = item_name_to_id(item_name)
	return name
